    //根据base64编码生成图片
    public static boolean GenerateImage(String imgStr,String newPath) { // 对字节数组字符串进行Base64解码并生成图片
        if (imgStr == null) // 图像数据为空
        {
            return false;
        }
        BASE64Decoder decoder = new BASE64Decoder();
        try {
            // 1）截取获取到的base64编码,去掉前缀"data:image/png;base64," || "data:image/jpeg;base64,",只取base64编码
            //String[] imgBase64 = imgStr.split("base64,");
            // 2）重点：在传 base64编码 的时候，会把 base64编码 中的 "+" 号换成空格，所以需要先将base64中的空格转换回来，再进行保存操作！！！
            /*byte[] buffer = new BASE64Decoder().decodeBuffer(imgBase64[1].replaceAll(" ", "+"));*/
            // Base64解码
            //byte[] b = decoder.decodeBuffer(imgBase64[1]);
            byte[] b = decoder.decodeBuffer(imgStr);
            for (int i = 0; i < b.length; ++i) {
                if (b[i] < 0) {// 调整异常数据
                    b[i] += 256;
                }
            }
            // 生成图片
            OutputStream out = new FileOutputStream(newPath);
            out.write(b);
            out.flush();
            out.close();
            return true;
        } catch (Exception e) {
            return false;
        }
    }

    public static boolean GenerateImage(StringBuilder imgStr,String newPath) { // 对字节数组字符串进行Base64解码并生成图片
        if (imgStr == null) // 图像数据为空
        {
            return false;
        }
        BASE64Decoder decoder = new BASE64Decoder();
        try {
            // 1）截取获取到的base64编码,去掉前缀"data:image/png;base64," || "data:image/jpeg;base64,",只取base64编码
            //String[] imgBase64 = imgStr.split("base64,");
            // 2）重点：在传 base64编码 的时候，会把 base64编码 中的 "+" 号换成空格，所以需要先将base64中的空格转换回来，再进行保存操作！！！
            /*byte[] buffer = new BASE64Decoder().decodeBuffer(imgBase64[1].replaceAll(" ", "+"));*/
            // Base64解码
            //byte[] b = decoder.decodeBuffer(imgBase64[1]);
            byte[] b = decoder.decodeBuffer(imgStr.toString());
            for (int i = 0; i < b.length; ++i) {
                if (b[i] < 0) {// 调整异常数据
                    b[i] += 256;
                }
            }
            // 生成图片
            OutputStream out = new FileOutputStream(newPath);
            out.write(b);
            out.flush();
            out.close();
            return true;
        } catch (Exception e) {
            return false;
        }
    }


    @Test
    public void test05() {
        List<Book> list = new ArrayList<>();
        {
            list.add(new Book("Core Java",300));
            list.add(new Book("Learning Freemarker",150));
            list.add(new Book("Hibernate",200));
            list.add(new Book("Hibernate",300));
        }
        list.stream().filter(distinctByKey(b -> b.getName()))
                .forEach(b -> System.out.println(b.getName()+ "," + b.getId()));
    }
    public static <T> Predicate<T> distinctByKey(Function<? super T, Object> keyExtractor) {
        Map<Object, Boolean> seen = new ConcurrentHashMap<>();
        System.out.println("这个函数将应用到每一个item");
        return t -> seen.putIfAbsent(keyExtractor.apply(t), Boolean.TRUE) == null;
    }


